function createSecondaryHazard(PH) {

	var Div = "RSSHS"
	var Pv = document.getElementById(PH).value
	missing = Pv;
	var Sid = "SH" + numSecondaryHazards;
	var labid = "LSHid" + numSecondaryHazards;

	// Putting the primary hazard into the chosen hazards list only if it is not already there
	if (selectedHazards.indexOf(Pv) == -1) {
		if (Pv != "N/A") {
			selectedHazards.push(Pv);
		}
	}

	// Pushing previously chosen secondary hazards to the selected hazards list
	for (var i = 0; i < numSecondaryHazards; i++) {
		if (selectedHazards.indexOf(document.getElementById("SH"+i).value) == -1) {
			if (document.getElementById("SH" + i).value != "N/A") {
				selectedHazards.push(document.getElementById("SH"+i).value);
			}
		}
	}

	SHA.push(Sid)
	var list = ["N/A", "Altered Gravity", "Radiation", "Distance from Earth", "Isolation and Containment", "Hostile Closed Enviroment"]
	var lab = document.createElement("label")
	lab.innerHTML = "Secondary Hazard"
	lab.id = labid;
	var sel = document.createElement("select")
	sel.id = Sid
	// Loop only creates a new option if the hazard has not already been selected
	for (let i = 0; i < 6; i++) {
		if (selectedHazards.indexOf(list[i]) == -1) {
			let opt = document.createElement("option")
			opt.value = list[i]
			opt.innerHTML = list[i]
			opt.id = list[i]
			sel.appendChild(opt)
		}
	}

	var br1 = document.createElement("br")
	if (SH) {
		var br2 = document.createElement("br")
		document.getElementById(Div).appendChild(br2)
	}
	document.getElementById(Div).appendChild(br1)
	document.getElementById(Div).appendChild(lab)
	document.getElementById(Div).appendChild(sel)
	SH = true

	if (!document.getElementById("deleteButton")) {
		var deleteButton = document.createElement("button");
		deleteButton.innerHTML = "Clear Secondary Hazards";
		deleteButton.type = "button";
		deleteButton.id = "deleteButton";
		deleteButton.onclick = function() {
			document.getElementById("RSSHS").innerHTML = "";
			document.getElementById("deleteButton").remove();
			numSecondaryHazards = 0;
			selectedHazards = [];
			SH = false;
		}
		document.getElementById("hazardsButtonDiv").appendChild(deleteButton);
	}

	numSecondaryHazards++;

}

