function createAdditionalCounterMeasures() {
	var div = document.getElementById("ALxCAE")//Div id
	var ALxCAid = "ALxCA" + numSecondaryAssessments;
	LxCAA.push(ALxCAid)
	var Hdid = "HALxCAid" + numSecondaryAssessments;
	var Head = document.createElement("h4")
	Head.id = Hdid
	var ALXCA = document.createElement("textarea")
	ALXCA.id = ALxCAid
	ALXCA.cols = "50"
	div.appendChild(Head)
	div.appendChild(ALXCA)
	if (!document.getElementById("deleteButton")) {
		var deleteButton = document.createElement("button");
		deleteButton.innerHTML = "Clear Additional Countermeasures";
		deleteButton.type = "button";
		deleteButton.id = "deleteButton";
		deleteButton.onclick = function() {
			// document.getElementById(Sid).remove();
			// document.getElementById(deleteButton.id).remove();
			// document.getElementById(labid).remove();
			// br1.remove();
			document.getElementById("ALxCAE").innerHTML = "";
			document.getElementById("deleteButton").remove();
		}
		document.getElementById("additonalCounterMeasuresButtonDiv").appendChild(deleteButton);
	}
	numSecondaryAssessments++

}

